drop table x_comm_pattern_score;

create table x_comm_pattern_score
(
model_type varchar(10),
sample varchar(10),
account_number varchar(12),
status varchar(40),
active number,
drna  number,
refi number,
retained number,
sold number,
group_type varchar(40),
modeled_payoff number,
modeled_recap number,
drna_decile number,
refi_decile number,
retained_decile number,
sold_decile number,
payoff_decile number,
recap_decile number
);
commit;

insert into x_comm_pattern_score
		SELECT
		'VERSION 1' as model_type,
		case when v.account_number is null then 'MODEL' else 'VALID' end as sample,
		X.*,
		NTILE(10) OVER(ORDER BY DRNA DESC) AS DRNA_DECILE,
		NTILE(10) OVER(ORDER BY REFI DESC) AS REFI_DECILE,
		NTILE(10) OVER(ORDER BY RETAINED DESC) AS RETAINED_DECILE,
		NTILE(10) OVER(ORDER BY SOLD DESC) AS SOLD_DECILE,
		NTILE(10) OVER(ORDER BY MODELED_PAYOFF DESC) AS PAYOFF_DECILE,
		NTILE(10) OVER(ORDER BY MODELED_RECAP DESC) AS RECAP_DECILE
