		(
		select a.account_number, STATUS,

		-- SQL Predictive Model

		--Block # 1: Calculates the probability that '(STATUS)' equals 'ACTIVE'
		(CASE
		WHEN ("EVENT1" is null or "EVENT1" = 'CSRV-INSIN' or "EVENT1" = 'CSRV-INSOUT' or "EVENT1" = 'CSRV-MODINQ' or "EVENT1" = 'CSRV-NOPAY' or "EVENT1" = 'CSRV-WBONBL' or "EVENT1" = 'MKTG-Account Review' or "EVENT1" = 'MKTG-Cash Out' or "EVENT1" = 'MKTG-HAMP-to-HARP' or "EVENT1" = 'MKTG-Interest Savings' or "EVENT1" = 'MKTG-PI Savings' or "EVENT1" = 'WEB-SW') THEN
