						0.0e0
					WHEN ("CALL_COUNT" >= 3.0e0 and "CALL_COUNT" <= 101.0e0) THEN
						0.020202020202020204e0
					ELSE
						0.010431353055493357e0
					END)
				ELSE
					0.006954936949745565e0
				END)
			WHEN ("DAYS_SINCE_LAST_EVENT" >= 27.0e0 and "DAYS_SINCE_LAST_EVENT" <= 153.0e0) THEN
				0.0e0
			ELSE
				0.006942406134490917e0
			END)
		ELSE
			0.12729319210626677e0
		END) as modeled_recap


		from x_comm_pattern a
		--where rownum < 10
		) X,
x_comm_pattern_v v
where x.account_number = v.account_number(+);
commit;

select model_type, sample, count(*) from x_comm_pattern_score group by model_type, sample order by 1;
